import React from 'react';
import '../../css/home-page/products.css';

export default function Product () {
    async function getProducts() {
        let result = await fetch('https://my-json-server.typicode.com/tdmichaelis/json-api/products');
        let object = await result.json();
        let final = ``;
        object.map(Product => {
            final += ( <div className={'Product'}>
                <div className={'Image'}><img src={Product.img}/></div>
                <div className={'Body'}>
                    <div className={'Title'}>{Product.name}</div>
                    <div className={'Description'}>{Product.description}</div>
                    <div className={'Ratings'}>
                        <div className={'Input'}>
                            <div className={'Price'}>${Product.price}</div>
                            <div className={'Stars'}>4.6</div>
                        </div>
                        <button>Add to Cart</button>
                    </div>
                </div>
            </div> )
        });

        return final;
    }

    getProducts().then(r => null);

}
